import axios from 'axios'
import { ADD_TO_CART, REMOVE_TO_CART } from '../constants'


export const addToCart = () => {
    console.log("hello world")
    return {
        type: ADD_TO_CART,
    }
}
export const removeToCart = () => {


    return {
        type: REMOVE_TO_CART
    }
}

export const show_posts = () => {
    return (dispatch) => {
        return axios.get("https://629dae743dda090f3c07dd7f.mockapi.io/fakeapi").then(result => {
                dispatch({
                    type: "GET_POST",
                    payload: result.data
                })
            })

    }
}
